scopecontent.p:
This series consists of drafts of several books, short stories, and articles 
		  authored by Leona Train Rienow, many of which are undated. Drafts pertaining to her 
		  books include The Friar's Lantern; A 
		  Kingdom for Ethelfleda; Locusts; Mystery 
		  of the Midnight Fire; Fleda, King Alfred's Daughter; 
		  Mesaba Plunder; and River without Any End. 
		  Drafts of short stories include Bed and Breakfast; 
		  Cradle of Humanity; Fair on Morrow; 
		  Gekocht Aardappelen; Gory Glory; 
		  The Great Salt Age; Hospitality-Old World Style; 
		  I Dare You to Sleep in Your Own Guest Room; 
		  I Dare You to Sleep in Your Own Spare Room; It's the British Air!; 
		  Monuments by God; Peasoup and Snails; 
		  Peeking Gendarmes; Professor, Your Goodwill 
		  is Showing; Screwball Authorities: Our Idolatry of Big Names; 
		  Tourists Delight; You Can't Buck Tradition; 
		  and We Become Class-Conscious.
